settings.labelFunction:
var color;
if(dsData[dsIndex].active !== "true"){
    color = 'rgb(255, 0, 0)';
} else {
    color = 'rgb(39, 134, 34)';
}
return '<span style="border: solid ' + color + '; border-radius: 10px; color: ' + color + '; background-color: #fff; padding: 3px 5px; font-size: 14px">' + 
           '${entityName}'+
        '</span>'

settings.colorFunction:
var type = dsData[dsIndex]['Type'];
if (type == 'colorpin') {
	var temperature = dsData[dsIndex]['temperature'];
	if (typeof temperature !== undefined) {
	    var percent = (temperature + 60)/120 * 100;
	    return tinycolor.mix('blue', 'red', percent).toHexString();
	}
	return 'blue';
}

settings.markerImageFunction:
var type = dsData[dsIndex]['Type'];
if (type == 'thermometer') {
	var res = {
	    url: images[0],
	    size: 40
	}
	var temperature = dsData[dsIndex]['temperature'];
	if (typeof temperature !== undefined) {
	    var percent = (temperature + 60)/120;
	    var index = Math.min(3, Math.floor(4 * percent));
	    res.url = images[index];
	}
	return res;
}

actionCellButton.customFunction:
var title;
var content;
if (entityName) {
  title = entityName + ' details';
  content = '<b>Alarms for Entity name: </b>: ' + entityName;
  if (additionalParams && additionalParams.entity) {
    var entity = additionalParams.entity;
    if (entity.id) {
      content += '<br><b>Alarm</b>: ' + additionalParams.AlarmDataInfo;
    }

  }
} else {
  title = 'No entity information available';
  content = '<b>No entity information available</b>';
}

showAlertDialog(title, content);

function showAlertDialog(title, content) {
  setTimeout(function() {
    widgetContext.dialogs.alert(title, content).subscribe();
  }, 100);
}

